import React, { Component } from 'react';
import './App.css';
import Navbar from './components/navbar/navbar';
import Footer from "./components/footer/footer"
import Game from "./components/game/game"

let highscore = 0
let score =0


class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar/>
        <Game />
        <Footer/>
      </div>
    );
  }
}

export default App;
